import { useCallback, useEffect, useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import { onAuthStateChanged, signOut } from "firebase/auth"; 
import { auth } from "./firebase"; 
import { useSpring, animated } from "@react-spring/web";
import "./AllAssessments.css";

const AllAssessments = () => {
  const navigate = useNavigate();
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [typedText, setTypedText] = useState("");
  const footerRef = useRef(null);

  const fullText = "ADHDR: integrating gamification and dynamic questionnaires to simplify the diagnosis process";

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) setTypedText(""); // Reset typing when in view
      },
      { threshold: 0.5 }
    );
    if (footerRef.current) observer.observe(footerRef.current);
    return () => observer.disconnect();
  }, []);

  useEffect(() => {
    if (typedText.length === fullText.length) return;
    const typingInterval = setInterval(() => {
      setTypedText((prev) => prev + fullText[prev.length]);
    }, 100);
    return () => clearInterval(typingInterval);
  }, [typedText]);

  useEffect(() => {
    const unsubscribe = onAuthStateChanged(auth, (user) => {
      setIsLoggedIn(!!user);
    });
    return () => unsubscribe();
  }, []);

  const handleLogout = async () => {
    try {
      await signOut(auth);
      setIsLoggedIn(false);
      navigate("/");
    } catch (error) {
      console.error("Logout failed:", error);
    }
  };

  const handleNavigation = useCallback((path) => {
    navigate(path);
  }, [navigate]);

  const newTab = (url) => {
    window.open(url, "_blank");
  };

  const fadeProps = useSpring({
    opacity: 1,
    transform: "translateY(0px)",
    from: { opacity: 0, transform: "translateY(50px)" },
    config: { duration: 800 },
  });

  return (
    <div className="contact-us-page">
      <div className="home">
        {/* Header Section */}
        <div className="header">
          {[
            { name: "ADHDR", path: "/" },
            { name: "About Us", path: "/about-us" },
            { name: "Your Results", path: "/your-results" },
            { name: "ADHD Resources", path: "/adhd-resources" },
            { name: "Contact Us", path: "/contact" }
          ].map((item) => (
            <div 
              key={item.name} 
              className={`nav-item ${window.location.pathname === item.path ? "nav-item-active" : ""}`}
              onClick={() => handleNavigation(item.path)}
            >
              {item.name}
            </div>
          ))}

          <div className="nav-item" onClick={isLoggedIn ? handleLogout : () => handleNavigation("/login")}>
            {isLoggedIn ? "Log Out" : "Login or Sign Up"}
          </div>
        </div>

        {/* Main Content Section */}
        <animated.div style={fadeProps} className="content-wrapper">
          <div className="about-title">
            <h1>Take our Assessments!</h1>
            <p className="tagline">Click on our original, interactive, and dynamic assessments!</p>
          </div>

          <div className="content-sections">
            {/* Game Cards */}
            {[
              {
                title: "Berry Blitz",
                imgSrc: "/image-1@2x.png",
                url: "http://berryblitz.neurohealthalliance.org",
                description:
                  "Can you collect all of the fruits while avoiding the shurikens? This energetic, intense game will test your reflexes..."
              },
              {
                title: "Magic Castle",
                imgSrc: "/magic-castle@2x.png",
                url: "",
                description: "Game Coming Soon!"
              },
              {
                title: "Kitchen Quest",
                imgSrc: "/screenshot-20240825-213042-1@2x.png",
                url: "https://adhdr.itch.io/kitchen-quest",
                description:
                  "Can you gather all the ingredients and prepare the perfect dish? This fun and interactive game challenges you to..."
              }
            ].map((game, index) => (
              <div className="section-wrapper" key={index}>
                <div className="section-card">
                  <div className="image-container">
                    <img
                      className="berry-blitz-button"
                      alt={game.title}
                      src={game.imgSrc}
                      onClick={() => game.url && newTab(game.url)}
                      style={{ cursor: game.url ? "pointer" : "default" }}
                    />
                    <div className="overlay">
                      <p className="overlay-text" onClick={() => game.url && newTab(game.url)}>
                        {game.description}
                      </p>
                    </div>
                  </div>
                </div>
                <h2 className="game-title">{game.title}</h2>
              </div>
            ))}
          </div>
        </animated.div>

        {/* Footer Section */}
        <div className="navigation-footer1" ref={footerRef}>
          <div className="adhdr3">
            <p className="adhdr4">
              {typedText}
              {typedText.length < fullText.length && <span className="ellipsis">...</span>}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AllAssessments;
